import React from 'react';
import { Link } from 'react-router-dom';

const HomePage = () => {
  return (
    <>
      {/* Import Google Fonts */}
      <link
        href="https://fonts.googleapis.com/css2?family=Inter:wght@400;600;900&display=swap"
        rel="stylesheet"
      />
      <style>{`
        /* Reset and base */
        * {
          box-sizing: border-box;
        }
        body, html, #root {
          margin: 0; 
          padding: 0; 
          height: 100%;
          font-family: 'Inter', -apple-system, BlinkMacSystemFont, 'Segoe UI', Roboto, Oxygen,
            Ubuntu, Cantarell, 'Open Sans', 'Helvetica Neue', sans-serif;
          background: #f5f7fb;
          overflow-x: hidden;
        }

        /* Background shapes */
        body::before {
          content: "";
          position: fixed;
          top: -120px;
          right: -120px;
          width: 520px;
          height: 520px;
          background: linear-gradient(135deg, #6466f1 0%, #9e92f2 100%);
          border-radius: 50%;
          opacity: 0.3;
          filter: blur(80px);
          pointer-events: none;
          z-index: -2;
        }
        body::after {
          content: "";
          position: fixed;
          bottom: -160px;
          left: -140px;
          width: 480px;
          height: 480px;
          background: linear-gradient(135deg, #64b5f6 0%, #90caf9 100%);
          border-radius: 45%;
          opacity: 0.18;
          filter: blur(100px);
          pointer-events: none;
          z-index: -2;
        }

        /* Fade zoom animation */
        @keyframes fadeZoomIn {
          0% {
            opacity: 0;
            transform: scale(0.92);
          }
          100% {
            opacity: 1;
            transform: scale(1);
          }
        }

        /* Container */
        .container {
          min-height: 100vh;
          display: flex;
          justify-content: center;
          align-items: center;
          flex-direction: column;
          padding: 0 1rem;
          animation: fadeZoomIn 1s ease forwards;
        }

        /* Card style */
        .card {
          background: #fff;
          padding: 3rem 3.5rem;
          border-radius: 20px;
          max-width: 460px;
          width: 100%;
          box-shadow:
            0 2px 20px rgb(101 88 199 / 15%),
            0 10px 55px rgb(182 169 255 / 20%);
          text-align: center;
          will-change: transform;
          transition: transform 0.3s ease;
        }
        .card:hover {
          transform: translateY(-6px);
          box-shadow:
            0 6px 30px rgb(101 88 199 / 25%),
            0 18px 80px rgb(182 169 255 / 30%);
        }

        /* Heading */
        h1 {
          font-weight: 900;
          font-size: 2.8rem;
          margin-bottom: 0.35rem;
          color: #3b3669;
          letter-spacing: 0.05em;
          text-transform: uppercase;
          user-select: none;
        }

        /* Intro text */
        p.description {
          margin-bottom: 2.7rem;
          color: #6b7280;
          font-size: 1.15rem;
          font-weight: 500;
          line-height: 1.55;
          user-select: none;
        }

        /* Buttons container */
         .button-group {
    display: flex;
    justify-content: center;
    gap: 1.6rem;
    flex-wrap: nowrap; /* Keep buttons in one line */
  }

        /* Common button styles */
        .btn {
          display: inline-flex;
          align-items: center;
          justify-content: center;
          font-weight: 700;
          border-radius: 14px;
          padding: 0.8rem 2rem;

          font-size: 1rem;

          text-decoration: none;
          cursor: pointer;
          transition: all 0.28s cubic-bezier(0.4, 0, 0.2, 1);
          user-select: none;
          border: none;
          box-shadow: 0 10px 30px rgb(65 57 191 / 15%);
         min-width: 110px;
          gap: 0.6rem;
        }

        /* Login button (primary) */
        .btn-login {
          background: linear-gradient(45deg, #5750de, #7563fb);
          color: #fff;
          box-shadow: 0 12px 40px rgb(87 80 222 / 35%);
          border: none;
        }
        .btn-login:hover {
          background: linear-gradient(45deg, #7563fb, #5750de);
          box-shadow: 0 14px 48px rgb(117 99 251 / 45%);
          transform: translateY(-4px);
        }

        /* Signup button (secondary) */
        .btn-signup {
          background: transparent;
          color: #5750de;
          border: 2.5px solid #786df0;
          box-shadow: none;
        }
        .btn-signup:hover {
          background: #786df0;
          color: white;
          box-shadow: 0 14px 48px rgb(120 109 240 / 40%);
          transform: translateY(-4px);
        }

        /* Icon styles (SVG inline) */
        .btn svg {
          width: 18px;
          height: 18px;
          fill: currentColor;
        }

        /* Footer */
        footer {
          margin-top: 3.5rem;
          font-weight: 500;
          color: #a1a1aa;
          letter-spacing: 0.06em;
          user-select: none;
          font-size: 0.95rem;
          text-align: center;
        }

        /* Responsive */
        @media (max-width: 480px) {
          .card {
            padding: 2.5rem 2rem;
          }
          .btn {
            min-width: 115px;
            font-size: 1rem;
          }
        }
      `}</style>

      <main className="container" role="main" aria-label="Home page welcome and navigation">
        <section className="card" aria-labelledby="homepage-welcome">
          <h1 id="homepage-welcome">Store Rating App</h1>
          <p className="description">
            Welcome! Discover, rate, and manage stores with rich feedback and seamless user experience.
          </p>
          <nav className="button-group" aria-label="Authentication actions">
            <Link to="/login" className="btn btn-login" aria-label="Login to your account">
              {/* Login icon */}
              <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 24 24" aria-hidden="true" focusable="false">
                <path d="M10 17l5-5-5-5v10zM19 19h-2v-2h2v2zm-2-14v2h2v-2h-2z"/>
                <path fill="none" d="M0 0h24v24H0z"/>
              </svg>
              Login
            </Link>
            <Link to="/signup" className="btn btn-signup" aria-label="Create a new account">
              {/* Signup icon */}
              <svg xmlns="http://www.w3.org/2000/svg" viewBox="0 0 24 24" aria-hidden="true" focusable="false">
                <path d="M12 7v10m5-5H7" stroke="currentColor" strokeWidth="2" strokeLinecap="round" strokeLinejoin="round"/>
              </svg>
              Signup
            </Link>
          </nav>
        </section>

        <footer>
          &copy; {new Date().getFullYear()} Store Rating App â€” Crafted for your success
        </footer>
      </main>
    </>
  );
};

export default HomePage;
